def count_sequences(m, n):
    # Base case: If n is 0, there are no sequences.
    if n == 0:
        return 0

    # Base case: If m is 0, there is only one sequence (with all elements being 0).
    if m == 0:
        return 1

    # Recursive case: Count sequences by considering the first element in the sequence.
    count = 0
    for i in range(m, 0, -1):
        # Check if the next element is at least double of the current element.
        if i >= 2 * count_sequences(m, n-1):
            # Recursively count sequences with the next element being i.
            count += count_sequences(m, n-1)
        else:
            # If the next element is not at least double, break the loop since the subsequent elements will also not satisfy the condition.
            break

    return count

