def max_bitonic_sum(arr):
    # Find the length of the array
    n = len(arr)

    # Initialize two arrays to store the maximum increasing
    # sum and maximum decreasing sum ending at each index
    increasing_sum = [0] * n
    decreasing_sum = [0] * n

    # Calculate the maximum increasing sum ending at each index
    increasing_sum[0] = arr[0]
    for i in range(1, n):
        if arr[i] > arr[i-1]:
            increasing_sum[i] = increasing_sum[i-1] + arr[i]
        else:
            increasing_sum[i] = arr[i]

    # Calculate the maximum decreasing sum ending at each index
    decreasing_sum[n-1] = arr[n-1]
    for i in range(n-2, -1, -1):
        if arr[i] > arr[i+1]:
            decreasing_sum[i] = decreasing_sum[i+1] + arr[i]
        else:
            decreasing_sum[i] = arr[i]

    # Find the maximum bitonic sum
    max_bitonic_sum = float('-inf')
    for i in range(n):
        bitonic_sum = increasing_sum[i] + decreasing_sum[i] - arr[i]
        if bitonic_sum > max_bitonic_sum:
            max_bitonic_sum = bitonic_sum

    # Return the maximum bitonic sum
    return max_bitonic_sum

