def search_in_rotated_array(arr, target):
    # Find the index of the smallest element in the array
    def find_smallest(arr):
        left = 0
        right = len(arr) - 1
        while left < right:
            mid = (left + right) // 2
            if arr[mid] > arr[right]:
                left = mid + 1
            else:
                right = mid
        return left

    # Search for the target element in the array
    def binary_search(arr, target, left, right):
        while left <= right:
            mid = (left + right) // 2
            if arr[mid] == target:
                return mid
            if arr[mid] < target:
                left = mid + 1
            else:
                right = mid - 1
        return -1

    # Find the index of the smallest element
    smallest_idx = find_smallest(arr)

    # Search for the target element in the left and right halves of the array
    result = binary_search(arr, target, 0, smallest_idx - 1)
    if result == -1:
        result = binary_search(arr, target, smallest_idx, len(arr) - 1)

    return result

