def find_common_elements(tuples):
    # Check if the list of tuples is empty
    if len(tuples) == 0:
        return set()

    # Convert the first tuple to a set
    common_elements = set(tuples[0])

    # Iterate through the remaining tuples
    for tpl in tuples[1:]:
        # Convert the current tuple to a set
        current_elements = set(tpl)

        # Update the common elements by taking the intersection with the current elements
        common_elements = common_elements.intersection(current_elements)

